import React from 'react';
import { useSelector } from 'react-redux';

import { selectIsFetching } from '../../redux/data/data.selectors';
import { selectOnNavigation } from '../../redux/navigation/navigation.selectors';
import { selectDisplayHome } from '../../redux/myhome/myhome.selectors';

import { mobileAndTabletcheck } from '../../assets/utils/utils';

import {
	HomeContainer,
	DetailContainer,
	FlagContainer,
	NavigationHomeContainer,
	DateContainer,
} from './myhome.styles';

const MyHome = () => {
	const isFetching = useSelector(selectIsFetching);
	const onNavigation = useSelector(selectOnNavigation);
	const onHome = useSelector(selectDisplayHome);
	const mobile = mobileAndTabletcheck();
	return isFetching ? (
		<div />
	) : mobile ? (
		<div>
			{onHome ? (
				<HomeContainer toggleNavigation={onHome}>
					<FlagContainer />
					<DetailContainer />
					<NavigationHomeContainer />
					<DateContainer />
				</HomeContainer>
			) : null}
		</div>
	) : (
		<HomeContainer>
			<FlagContainer />
			<DetailContainer />
			<NavigationHomeContainer />
			<DateContainer />
		</HomeContainer>
	);
};

export default MyHome;
